import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './containers/app.js';
import 'tachyons';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
  	<App />
  </React.StrictMode>,
  document.getElementById('root')
);
serviceWorker.unregister();
